  clothingArray,
  handleAddClick,
  handleLogoutClick,
  handleEditProfileClick,
  onCardClick,
  onCardLike,
  onClose,
  /*   getInitials, */
}) => {
  const { currentUser } = useContext(CurrentUserContext);
  return (
    <section className="profile">
      <Sidebar></Sidebar>

      <ClothesSection
        clothingArray={clothingArray}
        handleAddClick={handleAddClick}
        onCardLike={onCardLike}
        onCardClick={onCardClick}
      />
    </section>
  );
};
